/** @jsxImportSource @emotion/react */
import { container, productImageContainer } from './styles';
import ProductImage from '../../assets/product-image.jpg';

import { commentBoxStyle, commentBoxContainer } from './styles';

function CommentResult({ reviewData }) {
    if (!reviewData) {
        return 'no review yet';
    }

    return(
        <div css={container}>
            <div css={commentBoxStyle}>
                <div>{reviewData?.user?.username || ''}</div>
                <div>{reviewData.body || ''}</div>
            </div>
        </div>
    )
}

export default CommentResult;
